import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavbarComponent } from './shared/navbar/navbar.component';
import { FootorComponent } from './shared/footor/footor.component';
import { ComponenentsComponent } from './componenents/componenents.component';
import { HomeComponent } from './componenents/home/home.component';

@NgModule({
  declarations: [
    AppComponent,
    NavbarComponent,
    FootorComponent,
    ComponenentsComponent,
    HomeComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
